    <style>
      html, body {
        padding: 0;
        margin: 0;
        height: 100%;
        width: 100%;
        font-family: "Lato", sans-serif;
        color: #EEEEEE;
      }
      #viewDiv {
        margin:0;
        padding:0;
        width:100%;
        height:100%;
      }
      .plot-container {
        top: 0;
        left: 0;
        z-index:98;
        background-color: #393e46;
        overflow: hidden;
        position: absolute;
        height: 100%;
      }
      .popup {
        top: 0;
        left: 0;
        z-index:50;
        background-color: #393e46;
        overflow: hidden;
        position: absolute;
        transition: 0.5s;
        opacity: 0.8;
        border-radius: 5px;
        border: 1px solid black;
      }
      .tools-btn {
        font-size: 18px;
        cursor: pointer;
        z-index: 99;
        position: absolute;
        right: 2%;
        top: 2%;
        color: #EEEEEE;
      }
      
      .tools-btn:hover {
        color: #4ecca3;
      }
      
      .tools-btn:active {
        color: #4d6dcb;
      }

      .plt-ctn {
        margin: 0;
        position: absolute;
        width:100%;
        height:70%;
        padding: 5px;
        top: 5%;
      }

      .disable {
        top: 0;
        left: 0;
        z-index:80;
        opacity: 0.2;
        background-color: #393e46;
        overflow: hidden;
        position: absolute;
      }

      .control {
        overflow: hidden;
        position: absolute;
      }

      .warning {
        position: absolute;
        overflow: hidden;
        z-index: 99;
        top: 0;
        left: 0;
        opacity: 0.5;
        background-color: #FF0000;
        transition: 0.5s;
        width: 100%;
        height: 0;
      }

      #sliderDiv {
        position: absolute;
        z-index: 1;
        bottom: 0;
        border: 1px solid black;
        background-color: #FEFEFE;
        height: 50px;
        width: 100%;
      }

      table, td, tr, th {
        border: 1px solid #EEEEEE;
        border-collapse: collapse;
      }

      .tab {
        overflow: hidden;
        background-color: inherit;
        padding: 5px;
      }

      .tab button {
        background-color: inherit;
        color: #eeeeee;
        float: left;
        border: 1px solid #eeeeee;
        outline: none;
        cursor: pointer;
        padding: 14px 16px;
        transition: 0.3s;
      }

      .tab button:hover {
        background-color: #444444;
      }
      
      .tab button.active {
        background-color: #333333;
      }

      function logisticProjection(terms, n) {
        var y = [];
        var max = terms[0];
        var r = terms[1];
        var c = terms[2];
        var o = terms[3];
        for(var i = 0; i < n; ++i) {
          y.push(max/(1+Math.exp(-r*(i-c))) + o);
        }
        return y;
      }
      function exponentialProjection(terms, n) {
        var y = [];
        var p0 = terms[0];
        var r = terms[1];
        var a = terms[2];
        for(var i = 0; i < n; ++i) {
          y.push(p0 *Math.pow((1 + r), (i-a)))
        }
        return y;

        plot_bgcolor: 'rgba(0,0,0,0)',
        font: {
          family: 'Times New Roman, Times, serif',
          size: 12,
          color: '#EEEEEE'
        },
      };
      Plotly.newPlot('graph', data, plot_layout, {displaylogo:false});
    }
    function update() {
      hideControls();
      if(PLOT_TYPE == "TRACE") {
        updatePlot();
      } else if(PLOT_TYPE == "COMPARE") {
        updateCompare();
      } else if(PLOT_TYPE == "HIST") {
        updateHistogram();
      }
      updateTable();
    }
    function openPlot() {
      var elem = document.getElementById("plotDiv");
      var style = elem.style;
      style.padding="15px";
      style.width = "75%";
      style.height = "100%";
      update();
    }
    function toggleLog() {
      LOG_SCALE = !LOG_SCALE;
      update();
    }
    function setSelectValues(value) {
      
        var el = document.getElementById("country-select0");
        for (var i = 0; i < el.options.length; i++) {
          if (el.options[i].text === value) {
            el.selectedIndex = i;
            break;
          }
        }
      
        var el = document.getElementById("country-select1");
        for (var i = 0; i < el.options.length; i++) {
          if (el.options[i].text === value) {
            el.selectedIndex = i;
            break;
          }
        }
      
    }
</script>
